import './App.css';
import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Login from './components/login';
import Navbar from './components/navbar';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route path = "/login" element = {<Login/>} />
      </Routes>
      <header className="App-header">
        <p>
            Welcome to Dodgy Bank Co.
            Banking done wrong
        </p>
        <a>
            We specialize in the most unlawful transactions known to man
        </a>
      </header>
    </div>
  );
}

export default App;
